import{_ as a,o as e,c as t,Q as o}from"./chunks/framework.8f83280a.js";const _=JSON.parse('{"title":"故障排除","description":"如果您遇到问题，请先检查此页面。","frontmatter":{"description":"如果您遇到问题，请先检查此页面。"},"headers":[],"relativePath":"zh/docs/troubleshooting.md","filePath":"zh/docs/troubleshooting.md","lastUpdated":1695023955000}'),i={name:"zh/docs/troubleshooting.md"},r=o('<h1 id="故障排除" tabindex="-1">故障排除 <a class="header-anchor" href="#故障排除" aria-label="Permalink to &quot;故障排除&quot;">​</a></h1><h2 id="客户端没有启动" tabindex="-1">客户端没有启动 <a class="header-anchor" href="#客户端没有启动" aria-label="Permalink to &quot;客户端没有启动&quot;">​</a></h2><p>在大多数情况下，这是由于您使用的浏览器或操作系统的版本已过时。 请尝试将您的浏览器或操作系统更新至最新版本，然后重试。</p><p>虽然这种情况不会经常发生，但如果此后您的客户端仍然无法启动，则可能是缓存有问题。在这种情况下，请尝试清除缓存，然后重试。</p><h2 id="页面无法加载" tabindex="-1">页面无法加载 <a class="header-anchor" href="#页面无法加载" aria-label="Permalink to &quot;页面无法加载&quot;">​</a></h2><p>如果您的客户端确实启动，但在尝试加载页面时出现错误，请检查您的网络连接是否有错误。此外，请检查您尝试访问的服务器是否未关闭。</p><p>虽然这种情况不会经常发生，但也可能会出现缓存故障的情况。在这种情况下，请尝试清除缓存，然后重试。</p><p>任何剩余问题可能与您尝试访问的服务器有关，因此请联系其管理员。</p><h2 id="客户端速度很慢" tabindex="-1">客户端速度很慢 <a class="header-anchor" href="#客户端速度很慢" aria-label="Permalink to &quot;客户端速度很慢&quot;">​</a></h2><p>请尝试以下操作：</p><ul><li>在客户端设置中激活“减少 UI 动画”</li><li>在客户端设置中停用“对模态使用模糊效果”</li><li>在浏览器设置中激活硬件加速</li><li>升级您使用过的设备的规格</li></ul><h2 id="ui-的某些部分很奇怪-例如背景是透明的" tabindex="-1">UI 的某些部分很奇怪（例如背景是透明的） <a class="header-anchor" href="#ui-的某些部分很奇怪-例如背景是透明的" aria-label="Permalink to &quot;UI 的某些部分很奇怪（例如背景是透明的）&quot;">​</a></h2><p>当 UI 在更新过程中更改时，主题缓存系统可能会导致 UI 显示损坏。 按设置中的“清除缓存”即可解决此问题。</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>特别清除“客户端”缓存。 不要清除“浏览器”缓存。</p></div><h2 id="通知或天线的闪烁灯不会消失" tabindex="-1">通知或天线的闪烁灯不会消失 <a class="header-anchor" href="#通知或天线的闪烁灯不会消失" aria-label="Permalink to &quot;通知或天线的闪烁灯不会消失&quot;">​</a></h2><p>闪烁的指示灯表示未读内容。如果该指示灯不会消失，则通常有未读内容已被新传入的内容推开。 如果您认为已阅读所有内容，但指示灯仍然不会消失（可能是错误），您可以通过用户设置强制将所有内容标记为已读。</p><h2 id="重记按钮被遮挡" tabindex="-1">重记按钮被遮挡 <a class="header-anchor" href="#重记按钮被遮挡" aria-label="Permalink to &quot;重记按钮被遮挡&quot;">​</a></h2><p>仅限关注者的注释无法重新注释。</p><h2 id="ocean-web-ui-的特定部分未显示" tabindex="-1">Ocean Web UI 的特定部分未显示 <a class="header-anchor" href="#ocean-web-ui-的特定部分未显示" aria-label="Permalink to &quot;Ocean Web UI 的特定部分未显示&quot;">​</a></h2><p>如果您使用广告拦截器，可能会出现此类问题。 为了获得最佳的 Ocean 体验，请关闭它。</p><h2 id="ocean-web-ui-的某些部分未翻译" tabindex="-1">Ocean Web UI 的某些部分未翻译 <a class="header-anchor" href="#ocean-web-ui-的某些部分未翻译" aria-label="Permalink to &quot;Ocean Web UI 的某些部分未翻译&quot;">​</a></h2><p>在大多数情况下，这只是翻译尚未完成的问题，而不是错误。请等待该区域的翻译完成。 您也可以自己<a href="./ocean.html">参与翻译</a>。</p>',22),l=[r];function n(h,c,s,d,p,u){return e(),t("div",null,l)}const m=a(i,[["render",n]]);export{_ as __pageData,m as default};
